import React, { Component } from 'react';

import "./maincompo.css";
import { FiNavigation } from "react-icons/fi";
import Logo from "../../assets/logo.svg";
import { TiSocialYoutubeCircular } from "react-icons/ti";
import { FaFacebook } from "react-icons/fa";
class MainComp extends Component {

    render() {

        return (
            <React.Fragment>

                <div>
                    <p>We'd love to help</p>
                    <p>connect with us!</p>

                </div>








                <div className="card-group container">
                    <div className="card">
                        {/* <img className="card-img-top" src={Land1} alt="Card image cap" /> */}
                        <div className="Land1">

                            <div className="back1">
                                <div style={{ paddingTop: '50px' }}>
                                    <FiNavigation className="navi" /><br></br><br></br>
                                    <a href="#" className="east">Homes@crownedestategroup.com</a>
                                </div>
                            </div>
                        </div>

                    </div>






                    <div className="card">
                        {/* <img className="card-img-top" src={Land2} alt="Card image cap" /> */}
                        <div className="Land2">

                            <div className="back1">
                                <div style={{ paddingTop: '50px' }}>
                                    <FiNavigation className="navi" /><br></br><br></br>
                                    <a href="#" className="east">Homes@crownedestategroup.com</a>
                                </div>
                            </div>


                        </div>

                    </div>

                    <div className="card">
                        {/* <img className="card-img-top" src={Land3} alt="Card image cap" /> */}
                        <div className="Land3">
                            <div className="back1">
                                <div style={{ paddingTop: '50px' }}>
                                    <TiSocialYoutubeCircular className="navii" /> <FaFacebook className="fb" />
                                    <br></br><br></br>
                                    <a href="#" className="east">Find us on youtube and facebook </a>
                                </div>
                            </div>
                        </div>

                    </div>
                </div>



                <br></br>





            </React.Fragment>




        );



    }




}
export default MainComp;
